import React from 'react';
import './ContentWindow.css';

function ContentWindow() {
    return (
        <main className="content-window">
            <section className="ai-presentation">
                <p id="ai-text">Welcome! Click on a project tile to learn more about it.</p>
            </section>
            <section className="project-tiles">
                <div className="tile" id="project-1">
                    <img src="images/project1.jpg" alt="Project 1" />
                    <h2>Project 1</h2>
                    <p>A brief description of Project 1.</p>
                </div>

                <div className="tile" id="project-2">
                    <img src="images/project2.jpg" alt="Project 2" />
                    <h2>Project 2</h2>
                    <p>A brief description of Project 2.</p>
                </div>
            </section>
        </main>
    );
}

export default ContentWindow;
